import { palsInfo } from "../Utils/data.json";

const Pals = () => {
  return (
    <>
      <section id="pals">
        <div>
          <div className="arrowsNav">
            <picture>&lt;</picture>
          </div>

          <div className="arrowsNav">
            <picture>&gt;</picture>
          </div>

          {
            palsInfo.map(({ author, quote, ceo }) => {
              return (
                <div className="palsInfo">
                  <h1>OUR CLIENTS APPROVE</h1>
                  <p>
                    {quote}
                  </p>
                  <h2>
                    {aut} <br />
                    <span>CEO OF {ceo}</span>
                  </h2>
                </div>
              );
            })
          }
        </div>

        <div className="palsComp"></div>
      </section>
    </>
  );
}

export default Pals;
